import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Dietaryschedule = () => {
  const [nutritionData, setNutritionData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:3000/Nutrition');
        setNutritionData(response.data);
      } catch (error) {
        console.error('Error fetching nutrition data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="bg-white rounded shadow-md max-w-xl mx-auto p-8 mt-8 ml-8">
      <h2 className="text-3xl font-semibold mb-6">Bodybuilder's Nutrition Facts</h2>
      <table className="min-w-full bg-white border border-gray-300 rounded">
        <thead>
          <tr>
            <th className="py-2 px-4 bg-gray-100 border-b">Nutrient</th>
            <th className="py-2 px-4 bg-gray-100 border-b">Amount</th>
            <th className="py-2 px-4 bg-gray-100 border-b">% Daily Value</th>
          </tr>
        </thead>
        <tbody>
          {nutritionData &&
            nutritionData.map((item, index) => (
              <tr key={index} className={(index + 1) % 2 === 0 ? 'bg-gray-100' : ''}>
                <td className="py-2 px-4 border-b">{item.nutrient}</td>
                <td className="py-2 px-4 border-b">{item.amount}</td>
                <td className="py-2 px-4 border-b">{item.dailyValue}</td>
              </tr>
            ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dietaryschedule;
